import React from 'react';
import Chart from "./components/Charts";
import "./App.css"

import Cards from "./components/Cards";

class App extends React.Component {
	/**use async to make htttp call very easy* */

  render() {         
    return (
      <div className ="wrapper" >
        <div className="title-container"> 
        <br></br>
            <a href="/"><img className="logo" src="https://www.truecaller.com/img/truecaller-logo-blue.959ba34.png"   height="42" width="80"/></a>

                <ul className="menu">
                    <li>
                        <FacebookShareButton
                            url={"https://www.truecaller.com/"}>
                            <FacebookIcon
                            size={32}
                            round />
                        </FacebookShareButton> 
                    </li>
                    <li>
                        <TwitterShareButton
                            url={"https://www.truecaller.com/"}>
                            <TwitterIcon
                            size={32}
                            round />
                        </TwitterShareButton>                                
                    </li>
                    <li>                                    
                        <LinkedinShareButton
                            url={"https://www.truecaller.com/"}>
                            <LinkedinIcon
                            size={32}
                            round />
                        </LinkedinShareButton> 
                    </li>
                </ul>
            <hr></hr>
          <Cards  /> 
        </div>
      </div>
    );
  }
}

export default App;
